    false,nt"url": null,nt"notes": "NCEI Accession 0130661 includes physical
    and profile data collected aboard the FAIRWEATHER during project OPR-N395-FA-10
    in the Coastal Waters of SE Alaska from 2010-03-25 to 2010-04-06. These data include
    CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and
    WATER TEMPERATURE. The instruments used to collect these data include CTD and sound
    velocimeter - moving vessel profiler. These data were collected and submitted by
    the NOAA Office of Coast Survey in support of hydrographic multibeam surveys to
    meet NOAA charting requirements.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
